import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MainNavigation from "./compenents/layout/MainNavigation";
import Home from "./Home";


function App() {
	return (
		<div>
			<Router>
			<MainNavigation />
				<Switch></Switch>
				<Route path="/" element={<Home />} />
			</Router>
		</div>
	);
}

export default App;
